import React from 'react'
import Umbrela from '../../../assets/img/home/umbrela.png'

function Item1() {
	return (
	 <div className="flex items-center justify-center flex-wrap mx-auto py-6">
		 <div className="container">
				 <img src={Umbrela} className="object-contain img-size"></img>
		 </div>
	 </div>
	)
}

export default Item1;
